export const createRegister= async (options) =>  { const response = await  fetch("http://localhost:3000/users", {
    method: "POST",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json"
    },
    body: JSON.stringify(options)
  });

  const result = await response.json();
  return result;
}
